import React from "react";
import "./welcome"
import { Link } from "react-router-dom";
import { Component } from "react";
import "./logo.css";

import img1 from './images/Logo remake.png';
const logo = () => {
  return (
    <>
    <div className="bg">
  <img className="log" src={img1}></img>;
  <div>
   <a><Link to="/Welcome"><img className="button" src="https://cdn-icons-png.flaticon.com/512/1277/1277592.png"></img></Link></a>
  </div>
  </div>
  </>
  )
};

export default logo;
